import { IIdObject } from '@common/interfaces/id-object.interface';
import { UID } from '@common/interfaces/uid.interface';

export function findById<T extends IIdObject>(items: T[], id: UID): T | undefined {
    return items.find((f) => f.id.toString() === id.toString());
}
